const initialState = {
    widgets: [
        {
            _id: "123",
            name: "Widget 1"            
        },
        {
            _id: "234",
            name: "Widget 2"            
        },
        {
            _id: "456",
            name: "Widget 3"            
        }

    ]
}

const widgetReducer = (state = initialState, action) => {
    return state;
}

export default widgetReducer;
